package com.syntax.class8;

public class Taskcontinue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<=50;i++) {
			  if(i==15||i==6||i==9||i==21||i==18||i==27||i==30) {
				  continue;
			  }
			  System.out.print(i+" ");
		  
	}
		
		
		for(int i=1;i<=50;i++) {
			if(i%3==0) {
				continue;
			}
			System.out.print(i+ " ");
		}
		
		
		
	}

}
